import React from 'react';
import './ModalNavv.css'

const ModalNavv = ({activee, setActivee, childrene}) => {
    return (
        <div className={activee ? "modal activee" : "modall"} onClick={() => setActivee(false)}>
            <div className={activee ? "modal-cont activee" : "modal-cont2"} onClick={el => el.stopPropagation()}>
                {childrene}
            </div>
        </div>
    );
};

export default ModalNavv;
